export default function arondissements() {

    let MapContainer = document.getElementById('mapcontainer');

    MapContainer.on('click', 'marker', (e) => {
        MapContainer.flyTo({
        center: e.features[0].geometry.coordinates,
        zoom: 15
        });
        });
}
